import{_ as e,c as o,o as t,ag as s}from"./chunks/framework.Ds6Eueu6.js";const u=JSON.parse('{"title":"DROP PROTOCOL","description":"","frontmatter":{},"headers":[],"relativePath":"docs/7x/ref_guide/sql_commands/DROP_PROTOCOL.md","filePath":"docs/7x/ref_guide/sql_commands/DROP_PROTOCOL.md"}'),r={name:"docs/7x/ref_guide/sql_commands/DROP_PROTOCOL.md"};function i(n,a,l,c,d,p){return t(),o("div",null,a[0]||(a[0]=[s('<h1 id="drop-protocol" tabindex="-1">DROP PROTOCOL <a class="header-anchor" href="#drop-protocol" aria-label="Permalink to &quot;DROP PROTOCOL&quot;">​</a></h1><p>Removes a data access protocol from a database.</p><h2 id="synopsis" tabindex="-1"><a id="section2"></a>Synopsis <a class="header-anchor" href="#synopsis" aria-label="Permalink to &quot;&lt;a id=&quot;section2&quot;&gt;&lt;/a&gt;Synopsis&quot;">​</a></h2><div class="language- vp-adaptive-theme"><button title="Copy Code" class="copy"></button><span class="lang"></span><pre class="shiki shiki-themes github-light github-dark vp-code" tabindex="0"><code><span class="line"><span>DROP PROTOCOL [IF EXISTS] &lt;name&gt;</span></span></code></pre></div><h2 id="description" tabindex="-1"><a id="section3"></a>Description <a class="header-anchor" href="#description" aria-label="Permalink to &quot;&lt;a id=&quot;section3&quot;&gt;&lt;/a&gt;Description&quot;">​</a></h2><p><code>DROP PROTOCOL</code> removes the specified protocol from a database. You specify a protocol name in the <code>CREATE EXTERNAL TABLE</code> command to read data from or write data to an external data source.</p><p>You must be a superuser or the protocol owner to drop a protocol.</p><blockquote><p><strong>Caution</strong> If you drop a data access prococol, external tables that have been defined specifying the protocol will no longer be able to access the external data source.</p></blockquote><h2 id="parameters" tabindex="-1"><a id="section4"></a>Parameters <a class="header-anchor" href="#parameters" aria-label="Permalink to &quot;&lt;a id=&quot;section4&quot;&gt;&lt;/a&gt;Parameters&quot;">​</a></h2><p>IF EXISTS : Do not throw an error if the protocol does not exist. WarehousePG issues a notice in this case.</p><p>name : The name of an existing data access protocol.</p><h2 id="notes" tabindex="-1"><a id="section5"></a>Notes <a class="header-anchor" href="#notes" aria-label="Permalink to &quot;&lt;a id=&quot;section5&quot;&gt;&lt;/a&gt;Notes&quot;">​</a></h2><p>Dropping a data access protocol, does not drop the protocol&#39;s call handlers. You must drop these functions manually.</p><p>Be sure to remove any shared libraries that were used by the protocol from the WarehousePG hosts.</p><h2 id="compatibility" tabindex="-1"><a id="section6"></a>Compatibility <a class="header-anchor" href="#compatibility" aria-label="Permalink to &quot;&lt;a id=&quot;section6&quot;&gt;&lt;/a&gt;Compatibility&quot;">​</a></h2><p><code>DROP PROTOCOL</code> is a WarehousePG extension.</p><h2 id="see-also" tabindex="-1"><a id="section7"></a>See Also <a class="header-anchor" href="#see-also" aria-label="Permalink to &quot;&lt;a id=&quot;section7&quot;&gt;&lt;/a&gt;See Also&quot;">​</a></h2><p><a href="./CREATE_EXTERNAL_TABLE.html">CREATE EXTERNAL TABLE</a>, <a href="./CREATE_PROTOCOL.html">CREATE PROTOCOL</a></p><p><strong>Parent topic:</strong> <a href="./../sql_commands/sql_ref.html">SQL Commands</a></p>',19)]))}const m=e(r,[["render",i]]);export{u as __pageData,m as default};
